import React from 'react'

const Card = ({title, content, likes, author, postedOn}) => {
    const handleClick = async function(){
        console.log("Kuch to hua hai, kuch ho gaya hai")    
    }
  return (
    <div className="card" onClick={handleClick}>
        <h2 className="title truncate">{title}</h2>
        <div className="second">
            <div className="liked" style={{flexBasis:"15%"}}>{likes}<span style={{color:"red"}}>&#10084;</span></div>
            <div className="date truncate" style={{flexBasis:"30%"}}>{postedOn}</div>
            <div className="author truncate" style={{flexBasis:"50%", textAlign:"right"}}>{author}</div>
        </div>
        <div className="content truncate">
            {content}
        </div>
    </div>
  )
}

export default Card
